import React from 'react'
import Header from '../../component/Header'
import SubNavbar from '../../component/SubNavbar'
import Feature2 from '../../component/Feature2'
import StackedBarChart from '../../component/StackedBarChart'

const ServiceLevel = () => {
    const filters = [
        {
            label: "Filter by Ring Group",
            name: "filterByRingGroup",
            value: [
                "All ring groups",
                "agents 2",
                "agents 3",
            ]
        },

        {
            label: "Filter by Phone Number",
            name: "filterByPhoneNumber",
            value: [
                "All phone numbers",
                "Phone number 1",
                "Phone number 2",
            ]
        },

    ]

    const dataCalls = [
        {
            value: "86:18:34",
            label: "Total Wait Time",
        },
        {
            value: "01:27",
            label: "Average Wait Time",
        },
        {
            value: "15:08",
            label: "Longest Wait Time",
        },
        {
            value: "01:46",
            label: "Average Abandonment Time",
        },
    ]

    return (
        <div id="serviceLevel">
            <Header />
            <div className='main-content'>
                <SubNavbar />
                <Feature2
                    text="Inbound Call Metrics"
                />

                <div style={{ display: "flex", padding: "0 60px 40px 40px" }}>
                    {/* display filter */}
                    {filters.map((filter, index) => {
                        return (
                            <div style={{ paddingRight: "80px" }}>
                                <label for={filter.name}>{filter.label}</label>
                                <br></br>
                                <select name={filter.name} id={filter.name}
                                    style={{ width: "240px", height: "30px", fontSize: "14px" }}
                                >
                                    {filter.value.map((optionValue, optionIndex) => {
                                        return (
                                            <option value={optionValue}>{optionValue}</option>
                                        )
                                    })}
                                </select>
                            </div>
                        )
                    })}

                </div>

                {/* display Calls */}
                <div style={{ display: "flex", alignContent: "center", justifyContent: "center" }}>
                    {dataCalls.map((dataCall) => {
                        return (
                            <div style={{ padding: "0 100px 0 100px" }}>
                                <p style={{ fontSize: "30px", fontWeight: "600" }}>{dataCall.value}</p>
                                <div style={{ display: "flex", marginTop: "-20px", paddingBottom: "60px" }}>
                                    <p style={{ fontSize: "12px" }}>{dataCall.label}</p>
                                    <i class="fa-solid fa-circle-info"
                                        style={{ color: "#c0c0c0", padding: "10px 0 0 10px" }}></i>
                                </div>
                            </div>
                        )
                    })}
                </div>

                {/* display Stacked Bar Chart */}
                <StackedBarChart
                    data={dataStackedBarChart}
                    title="Number of Inbound Calls"
                    styleChart={{
                        display: "flex",
                        justifyContent: "center",
                        backgroundColor: "#E0E0E0",
                        padding: "100px 0px 40px 0px",
                        margin: "0 0px 10px 20px",
                        width: "1600px",
                        height: "600px",
                    }}
                    styleTitle={{
                        fontSize: "18px",
                        position: "relative",
                        left: "280px",
                        top: "-40px",
                        margin: "0 0 0 -200px",
                    }}
                />

            </div>

        </div>
    )
}

export default ServiceLevel
